import data from '../data/app.json';
import { Faker } from '../faker';

export class App {
  private readonly faker: Faker;

  constructor(faker: Faker) {
    this.faker = faker;
  }

  public name(): string {
    return this.faker.Random.element(data.names);
  }

  public version(): string {
    return (this.faker.Random.element(data.versions) as string)
      .split('.')
      .map(x => x.replace(/#/g, () => this.faker.Number.between(0, 9).toString()))
      .join('.');
  }

  public author(): string {
    return [this.faker.Name.firstName(), this.faker.Name.lastName()].join(' ');
  }
}

import { Faker } from '../faker';

export class Avatar {
  private SUPPORTED_FORMATS: string[] = ['png', 'jpg', 'bmp'];

  private readonly faker: Faker;

  constructor(faker: Faker) {
    this.faker = faker;
  }

  public image(
    slug: string | null = null,
    size: string = '300x300',
    format: string = 'png',
    set: string = 'set1',
    bgset: string | null = null,
  ): string {
    if (!this.isValidSize(size)) {
      throw new Error('Size should be specified in format 300x300');
    }
    if (!this.isFormatSupported(format)) {
      throw new Error(`Supported formats are ${this.SUPPORTED_FORMATS.join(', ')}`);
    }
    const filename = `${slug || this.words()}.${format}`;
    const bgsetQuery = bgset ? `&bgset=${bgset}` : '';

    return `https://robohash.org/${filename}?size=${size}&set=${set}${bgsetQuery}`;
  }

  private isValidSize(size: string): boolean {
    return /^\d+x\d+$/.test(size);
  }

  private isFormatSupported(format: string): boolean {
    return this.SUPPORTED_FORMATS.indexOf(format) >= 0;
  }

  private words(): string {
    return this.faker.Lorem.words(3).join('-');
  }
}

import data from '../data/bank.json';
import { Faker } from '../faker';

export class Bank {
  private readonly faker: Faker;

  constructor(faker: Faker) {
    this.faker = faker;
  }

  public name(): string {
    return this.faker.Random.element(data.names);
  }

  public swiftBic(): string {
    return this.faker.Random.element(data.swiftBics);
  }

  public iban(bankCountryCode: string = 'GB'): string {
    const details = data.ibanDetails.filter(x => x.bankCountryCode === bankCountryCode.toUpperCase())[0];
    const bcc = `${details.bankCountryCode}${this.faker.Number.between(10, 99)}`;
    const ilc = Array(parseInt(details.ibanLetterCode, 10))
      .fill('0')
      .map(() => String.fromCharCode(65 + this.faker.Number.between(0, 25)))
      .join('');
    const ib = Array(parseInt(details.ibanDigits, 10))
      .fill('')
      .map(() => this.faker.Number.between(0, 9))
      .join('');
    return `${bcc}${ilc}${ib}`;
  }
}

